We have seen how trivial doing a serial sequence of async tasks is with promises. It is simply a matter of chaining then calls. However, you might potentially want to run a series of async tasks and then do something with the results of all of these tasks. Promise provides a static Promise.all function that you can use to wait for n number of promises to complete. You provide it with an array of n promises and it gives you an array of n resolved values. Below we show Chaining as well as Parallel: // an async function to simulate loading an item from some server
function loadItem(id: number): Promise<{ id: number }> { return new Promise((resolve) => { console.log('loading item', id); setTimeout(() => { // simulate a server delay resolve({ id: id }); }, 1000); });
} // Chained / Sequential
let item1, item2;
loadItem(1) .then((res) => { item1 = res; return loadItem(2); }) .then((res) => { item2 = res; console.log('done'); }); // overall time will be around 2s // Concurrent / Parallel
Promise.all([loadItem(1), loadItem(2)]) .then((res) => { [item1, item2] = res; console.log('done'); }); // overall time will be around 1s Sometimes, you want to run a series of async tasks, but you get all you need as long as any one of these tasks is settled. Promise provides a static Promise.race function for this scenario: var task1 = new Promise(function(resolve, reject) { setTimeout(resolve, 1000, 'one');
});
var task2 = new Promise(function(resolve, reject) { setTimeout(resolve, 2000, 'two');
}); Promise.race([task1, task2]).then(function(value) { console.log(value); // "one" // Both resolve, but task1 resolves faster
});

