The noImplicitThis compiler option is used to detect logic errors when the this variable is accessed incorrectly. >tags: [[Error_TS5055]] [[Error_noImplicitThis]] Consider the following code: class NoImplicitThisClass { id: number = 1; printAfterWait() { let callback = function () { console.log(`this.id : ${this.id}`); } setTimeout(callback, 1000); }
} let classInstance = new NoImplicitThisClass();
classInstance.printAfterWait(); The compiler correctly identifies that our reference to this.id within the callback function is not referencing the this property of the NoImplicitThisClass class. The this property within the callback function, therefore, has a type of any, hence the error. There are two ways that we could correct this code. Using a callback function class NoImplicitThisClass { id: number = 1; printAfterWait() { let callback = function (_this) { console.log(`this.id : ${_this.id}`); } setTimeout(callback, 1000, this); } Using an arrow function let callback = () => { console.log(`this.id : ${this.id}`); } setTimeout(callback, 1000); module The "module" property sets the module system supported for the compiled program. During runtime, a module loader is used to locate and execute dependencies based on the specified module system. The most common module loaders used in JavaScript are Node.js CommonJS for server-side applications and RequireJS for AMD modules in browser-based web applications. TypeScript can emit code for various module systems, including UMD, System, ESNext, ES2015/ES6, and ES2020. Note: The module system should be chosen based on the target environment and the module loading mechanism available in that environment. moduleResolution The "moduleResolution" property specifies the module resolution strategy. Use "node" for modern TypeScript code, the "classic" strategy is used only for old versions of TypeScript (before 1.6). esModuleInterop The "esModuleInterop" property allows import default from CommonJS modules that did not export using the "default" property, this property provides a shim to ensure compatibility in the emitted JavaScript. After enabling this option we can use import MyLibrary from "my-library" instead of import - [x] as MyLibrary from "my-library". jsx The "jsx" property applies only to .tsx files used in ReactJS and controls how JSX constructs are compiled into JavaScript. A common option is "preserve" which will compile to a .jsx file keeping unchanged the JSX so it can be passed to different tools like Babel for further transformations. skipLibCheck The "skipLibCheck'' property will prevent TypeScript from type-checking the entire imported third-party packages. This property will reduce the compile time of a project. TypeScript will still check your code against the type definitions provided by these packages. files The "files" property indicates to the compiler a list of files that must always be included in the program. include The "include" property indicates to the compiler a list of files that we would like to include. This property allows glob-like patterns, such as "* " for any subdirectory, " " for any file name, and "?" for optional characters. exclude The "exclude" property indicates to the compiler a list of files that should not be included in the compilation. This can include files such as "node_modules" or test files. Note: tsconfig.json allows comments.

