Generics allow you to create reusable components and functions that can work with multiple types . With generics, you can parameterize types, functions, and interfaces, allowing them to operate on different types without explicitly specifying them beforehand. The key motivation for generics is to document meaningful type dependencies between members. The members can be: Class instance members Class methods function arguments function return value Many algorithms and data structures in computer science do not depend on the actual type of the object. However, you still want to enforce a constraint between various variables. A simple toy example is a function that takes a list of items and returns a reversed list of items. The constraint here is between what is passed in to the function and what is returned by the function: function reverse<T>(items: T[]): T[] { var toreturn = []; for (let i = items.length - 1; i >= 0; i--) { toreturn.push(items[i]); } return toreturn;
} var sample = [1, 2, 3];
var reversed = reverse(sample);
console.log(reversed); // 3,2,1 // Safety!
reversed[0] = '1'; // Error!
reversed = ['1', '2']; // Error! reversed[0] = 1; // Okay
reversed = [1, 2]; // Okay Here you are basically saying that the function reverse takes an array (items: T[]) of some type T (notice the type parameter in reverse<T>) and returns an array of type T (notice : T[]). Because the reverse function returns items of the same type as it takes, TypeScript knows the reversed variable is also of type number[] and will give you Type safety. Similarly if you pass in an array of string[] to the reverse function the returned result is also an array of string[] and you get similar type safety as shown below: var strArr = ['1', '2'];
var reversedStrs = reverse(strArr); reversedStrs = [1, 2]; // Error! In fact JavaScript arrays already have a .reverse function and TypeScript does indeed use generics to define its structure: interface Array<T> { reverse(): T[]; // ...
} This means that you get type safety when calling .reverse on any array as shown below: var numArr = [1, 2];
var reversedNums = numArr.reverse(); reversedNums = ['1', '2']; // Error! We will discuss more about the Array<T> interface later when we present lib.d.ts in the section Ambient Declarations .

