Freshness Allowing extra properties Use Case: React Strict object literal checking, sometimes referred to as freshness, is a feature in TypeScript that helps catch excess or misspelled properties that would otherwise go unnoticed in normal structural type checks. When creating an object literal, the TypeScript compiler considers it fresh. If the object literal is assigned to a variable or passed as a parameter, TypeScript will throw an error if the object literal specifies properties that do not exist in the target type. However, freshness disappears when an object literal is widened or a type assertion is used. TypeScript provides a concept of Freshness (also called strict object literal checking ) to make it easier to type check object literals that would otherwise be structurally type compatible. Here are some examples to illustrate: type X = { a: string };
type Y = { a: string; b: string }; let x: X;
x = { a: 'a', b: 'b' }; // Freshness check: Invalid assignment
var y: Y;
y = { a: 'a', bx: 'bx' }; // Freshness check: Invalid assignment const fn = (x: X) => console.log(x.a); fn(x);
fn(y); // Widening: No errors, structurally type compatible fn({ a: 'a', bx: 'b' }); // Freshness check: Invalid argument let x: { a: string } = { a: 'a' };
let y: { a: string; b: string } = { a: 'a', b: '' };
x = y; // Widening: No Freshness check Structural typing is extremely convenient . Consider the following piece of code. This allows you to very conveniently upgrade your JavaScript to TypeScript while still preserving a level of type safety : function logName(something: { name: string }) { console.log(something.name);
