Both Interators and Generators are well supported in TypeScript. Iterators are objects that implement the iterator protocol, providing a way to access elements of a collection or sequence one by one. It is a structure that contains a pointer to the next element in the iteration. They have a next() method that returns the next value in the sequence along with a boolean indicating if the sequence is done. class NumberIterator implements Iterable<number> { private current: number; constructor( private start: number, private end: number ) { this.current = start; } public next(): IteratorResult<number> { if (this.current <= this.end) { const value = this.current; this.current++; return { value, done: false }; } else { return { value: undefined, done: true }; } } [Symbol.iterator](): Iterator<number> { return this; }
} const iterator = new NumberIterator(1, 3); for (const num of iterator) { console.log(num);
} Generators are special functions defined using the function* syntax that simplifies the creation of iterators. They use the yield keyword to define the sequence of values and automatically pause and resume execution when values are requested. Generators make it easier to create iterators and are especially useful for working with large or infinite sequences. Example: function- [x] numberGenerator(start: number, end: number): Generator<number> { for (let i = start; i <= end; i++) { yield i; }
} const generator = numberGenerator(1, 5); for (const num of generator) { console.log(num);
} Iterator itself is not a TypeScript or ES6 feature, Iterator is a Behavioral Design Pattern common for Object oriented programming languages. It is, generally, an object which implements the following interface: interface Iterator<T> { next(value?: any): IteratorResult<T>; return?(value?: any): IteratorResult<T>; throw?(e?: any): IteratorResult<T>;
} ([More on that <T> notation later][generics]) This interface allows to retrieve a value from some collection or sequence which belongs to the object. The IteratorResult is simply a value+done pair: interface IteratorResult<T> { done: boolean; value: T;
} Imagine that there's an object of some frame, which includes the list of components of which this frame consists. With Iterator interface it is possible to retrieve components from this frame object like below: class Component { constructor (public name: string) {}
} class Frame implements Iterator<Component> { private pointer = 0; constructor(public name: string, public components: Component[]) {} public next(): IteratorResult<Component> { if (this.pointer < this.components.length) { return { done: false, value: this.components[this.pointer++] } } else { return { done: true, value: null } } } } let frame = new Frame("Door", [new Component("top"), new Component("bottom"), new Component("left"), new Component("right")]);
let iteratorResult1 = frame.next(); //{ done: false, value: Component { name: 'top' } }
let iteratorResult2 = frame.next(); //{ done: false, value: Component { name: 'bottom' } }
let iteratorResult3 = frame.next(); //{ done: false, value: Component { name: 'left' } }
let iteratorResult4 = frame.next(); //{ done: false, value: Component { name: 'right' } }
