Consider the simple Queue (first in, first out) data structure implementation. A simple one in TypeScript / JavaScript looks like: class Queue { private data = []; push(item) { this.data.push(item); } pop() { return this.data.shift(); }
} One issue with this implementation is that it allows people to add anything to the queue and when they pop it - it can be anything . This is shown below, where someone can push a string onto the queue while the usage actually assumes that only numbers were pushed in: class Queue { private data = []; push(item) { this.data.push(item); } pop() { return this.data.shift(); }
} const queue = new Queue();
queue.push(0);
queue.push("1"); // Oops a mistake // a developer walks into a bar
console.log(queue.pop().toPrecision(1));
console.log(queue.pop().toPrecision(1)); // RUNTIME ERROR One solution (and in fact the only one in languages that don't support generics) is to go ahead and create special classes just for these constraints. E.g. a quick and dirty number queue: class QueueNumber extends Queue { push(item: number) { super.push(item); } pop(): number { return this.data.shift(); }
} const queue = new QueueNumber();
queue.push(0);
queue.push("1"); // ERROR : cannot push a string. Only numbers allowed // ^ if that error is fixed the rest would be fine too Of course this can quickly become painful e.g. if you want a string queue you have to go through all that effort again. What you really want is a way to say that whatever the type is of the stuff getting pushed it should be the same for whatever gets popped . This is done easily with a generic parameter (in this case, at the class level): /** A class definition with a generic parameter */
class Queue<T> { private data = []; push(item: T) { this.data.push(item); } pop(): T | undefined { return this.data.shift(); }
} /** Again sample usage */
const queue = new Queue<number>();
queue.push(0);
queue.push("1"); // ERROR : cannot push a string. Only numbers allowed // ^ if that error is fixed the rest would be fine too Another example that we have already seen is that of a reverse function, here the constraint is between what gets passed into the function and what the function returns: function reverse<T>(items: T[]): T[] { var toreturn = []; for (let i = items.length - 1; i >= 0; i--) { toreturn.push(items[i]); } return toreturn;
} var sample = [1, 2, 3];
var reversed = reverse(sample);
console.log(reversed); // 3,2,1 // Safety!
reversed[0] = '1'; // Error!
reversed = ['1', '2']; // Error! reversed[0] = 1; // Okay
reversed = [1, 2]; // Okay In this section you have seen examples of generics being defined at class level and at function level . One minor addition worth mentioning is that you can have generics created just for a member function. As a toy example consider the following where we move the reverse function into a Utility class: class Utility { reverse<T>(items: T[]): T[] { var toreturn = []; for (let i = items.length - 1; i >= 0; i--) { toreturn.push(items[i]); } return toreturn; }
} TIP: You can call the generic parameter whatever you want. It is conventional to use T, U, or V when you have simple generics. If you have more than one generic argument try to use meaningful names like TKey and TValue. The convention is to prefix with T because generics are also called templates in other languages like C++.

