const asTask: T.Task<number> = () => { return new Promise((resolve) => { console.log('Doing stuff') return resolve(42); });
}; const result = pipe( thisIsATask, T.map(n => n + 1)
); Before we continue, lets take a small detour. As we mentioned several times before, functional programming tries to keep everything pure and thus easy to reason with. Side effects and I/O ruin this condition because they add impurity to our program. If our function uses I/O, it gives different results, despite having the same input. For instance, if we call the Lambda were monitoring more frequently, we get back a different sum. This is why FP does the best it can and moves all this content to the edge. So, despite what we might be expecting, this is pure because nothing is actually happening. Theres no asynchronous behavior (that is, a Promise) being run. At some point, well actually have to run the Task. Otherwise, why did we create it? That said, FP leaves this responsibility to the applications user. Do we actually want to get things done? In that case, simply invoke the function and well be responsible for the result! Notice that the logging appears. As a result, the program were writing will be pure and free of side effects. That is, it will be pure until, at the final step, we invoke the function to get back a Promise that contains the results we desperately desire. On a high level, were describing what we want the code to do. When its run, an interpreter decides what must actually happen. It decides whether it needs side effects. If the interpreter is a mock one, it might not need any side effects! Real interpreters probably will, though.

