Fold is very similar to reduce, which you might know from JavaScript or other languages. Its a function that takes a starting element and a function (so its another one of those higher-order functions) that knows how to combine the accumulated value with values from a list or array, which are fed in one by one. If we want to get the sum, this function would add the current element of the array to the accumulated value. Fold and reduce are very versatile. We can easily create functions like filter or map with reduce. Try it! Note: Fold and reduce are often used together with an array, which is why we give that as an example. We can also fold monoids and monads! Also, note that well often encounter a fold left and a fold right, differing only in starting element (left side of the array, or the right) and direction. Now we know what the above code does. It uses a fold to reduce the given array with monoidSum. This means that it will start with 0 and combine elements through addition. Because we now have a type we can work with, lets think about what we want to show our application users. Wed like to display the health of the Labda. As mentioned earlier, well do this with a status, which can take three different values, namely OK, WARN, and ERR. This is good for a brief overview of the situation. For more details, well also add a message that can contain further information. export type Status = 'OK' | 'WARN' | 'ERR'; export type ReducedStats = { readonly status: Status, readonly message: string,
} As usual, we limit our status to the types we specified because that makes the field easier to work with. Messages arent as easy to limit in value, so well let the message be a string. Transforming StatsSumResult=> ReducedStats The next big piece of the puzzle is a function to transform a single StatsSumResult into a ReducedStats. const statsSumToStatusAndMessage = (invokes: number) => (s: StatsSumResult) => { let status: Status = 'OK'; //2 let message = ''; switch (s.metric) { case 'Invocations': { status = invokes === 0 ? 'WARN' : 'OK'; //7 message = invokes === 0 ? 'not invoked' : 'invokes ok'; } break; case 'Errors': { const percentage = invokes !== 0 ? s.sum / invokes * 100 : 0; //12 status = percentage >= 5 ? 'ERR' : 'OK'; message = percentage >= 5 ? 'throwing errors' : 'no errors'; } break; case 'Throttles': { const percentage = invokes !== 0 ? s.sum / invokes * 100 : 0; //18 status = percentage >= 1 ? 'WARN' : 'OK'; (4) message = percentage >= 1 ? 'being throttled' : 'no throttles'; } break; default: const _exhaustiveCheck: never = s.metric; //24 return _exhaustiveCheck; } return { //28 status, message, } }; Lines 23: We start with an empty message and an OK status, which can be overwritten by the switch that follows. We have to tell TypeScript that status has the Status type, or it will assume that this is a string, which downstream code doesnt accept. Ideally, the compiler would notice that only three possible values, matching those of our type, appear in this piece of code and would conclude that this is equivalent to Status. TypeScript isnt there yet. Also, because Status doesnt have an empty string value, we cant initialize it as such. So, we start with the reasonable default of OK. Lines 78: Were using a switch to check each possible value for Metric, so (to recall from earlier in this chapter) we have three in total. This is the closest we can get to the power of pattern matching in other functional languages. Notice how, when we get an Invocations, we already have the answer ready. This is because we need the number of invocations in the Errors and Throttles cases as well, so we added it as the first parameter to this function. Line 12: Here, we handle Error and report an error when they exceed five percent of the total invocations of the function. This is why we take the sum, divide by the invokes, multiply by 100, and check the percentage we get. If there are no invocations, there wont be any errors, either. In that case, we return a 0. Note that the five percent threshold is a magic number and we might want to make this configurable. Thats quite easy to do through Lambda environment variables, which well use later in this chapter for getting the function name. If we dont think these values will change often, another approach could be to move the values to the constants file. Lines 1820: This is similar to the errors, except here we give back a warning when we have one percent (or more) throttles.We only give a warning here, though, not an error status. An occasional throttle is nothing unusual. Lines 2425: This is an exhaustiveness check, which weve already encountered once before. Say we had a fourth metric, called MagicInvocations, invocations of our Lambda that come out of nowhere. If MagicInvocations was a possible Metric type value, this default would try to assign it to _exhaustiveCheck, which has type never. We cant assign something to never. So, this check throws a warning at compile time if we add a metric but forget to handle it. Do note that an IDE might not understand this and might advise us to remove or change this default case in a way that will stop it from working. Lines 2830: We passed through the switch, so status and message now have the correct values, which we can return. Notice that were mutating two variables within this function. Isnt that a horrible mistake? While a different approach that doesnt mutate variables might turn out cleaner, the important thing to note is that were only mutating local variables. This function creates and manipulates variables, which means that we wont run into any issues with this mutability. If the golden rule is to avoid mutation, remember to limit the scope of any variable mutation you end up doing. Global variables, as we know, are bad. Unexposed mutation within a function is acceptable. Now we can produce a bunch of messages and strings. We actually just want to output one status and one message. How do we combine them? Well, how about using fold and a monoid? How would we go about combining two statuses? Clearly, if B says that everythings OK and B says that theres a warning, we want there to be a warning! Similarly, we prefer an error to a warning. So, we get the following: import {fold, monoidSum} from "fp-ts/Monoid"; const statusMonoid: Monoid<Status> = { concat: (x, y) => x === 'ERR' || y === 'ERR' ? 'ERR' : (x === 'WARN' || y === 'WARN' ? 'WARN' : 'OK'), empty: 'OK'
}; The monoid has a concat and an empty. Remember that the empty value is always overwritten by any other value. Here, the empty is OK because we always prefer a warning or an error to that value. The concat is written somewhat densely, but it shows what we just said, namely that error > warning > ok. Now a monoid for the messages: const messageMonoid: Monoid<string> = { concat: (x, y) => (x + ' ' + y).trim(), empty: '',
}; Its not perfect, but its good enough. The empty string will be overwritten by other values and we can combine two strings by appending. As we said earlier, monoids have a nice quality that theyre composable. Well use the fp-ts library to accomplish this. import { getStructMonoid } from 'fp-ts/lib/Monoid' const ReducedStatsMonoid: Monoid<ReducedStats> = getStructMonoid({ status: statusMonoid, message: messageMonoid
}); Using getStructMonoid, we say that the monoid for ReducedStats uses the two primitives above for its fields. The rest happens automatically. Now lets bring everything together. export const statsReducer = (results: readonly StatsSumResult[]): ReducedStats => { const invocations = results .filter(m => m.metric === 'Invocations') .map(m => m.sum) .shift() || 0; //5 const singleStatsSumMapper = statsSumToStatusAndMessage(invocations); return fold(ReducedStatsMonoid) (results.map(singleStatsSumMapper)); //10
}; Lines 57: We saw earlier that our statsSumToStatusAndMessage needs the number of invocations, so we retrieve those. If the value isnt present in our array, shift returns undefined and we return 0 instead. We couldve also used the ?? operator from TypeScript, but in this case, both are equally valid. Line 10: Next, we give the monoid we just wrote to fold and pass in all our StatsSumResult mapped to ReducedStats. The fold function reduces those to a single status and message. Its another nice example of the way FP allows us to write code at a higher level of abstraction. We merely say that we want the ReducedStats to be reduced into a single value. How this is done is none of our concern. Note: There are other equally valid ways to reduce the stats to a status plus message. Examples include forEach, map, and reduce. But this was a nice opportunity to show monoids in action. Returning results The last thing we want to do in regards to transforming is to give results back to the outside world. So, just in case someone puts us behind an AWS API Gateway and uses REST calls, well add a status code and related fields. type StatusCode = 200; export type HttpResult = { readonly statusCode: StatusCode, readonly body: string, readonly headers: Record<string, string>,
}; Line 1: For now, well define only one relevant code for the case when everything goes well. Lines 37: Well give back an http status code, the results in the body, and headers (which might be needed for protocols such as Cross-Origin Resource Sharing, or CORS). To go from our reduced stats to httpResultFromStats requires only a little work. export const httpResultFromStats = (result: ReducedStats): HttpResult => ({ statusCode: 200, body: JSON.stringify(result), headers: { 'Access-Control-Allow-Origin': '*' }
}); Note that when we return this from a Lambda, AWS knows how to interpret these values. It sees statusCode as a http status code. Similarly, everything inside headers is added as headers to the response. In case we decide to talk with browsers, were allowing every origin to call us, which adds security. With that, weve come to the end of our happy flow. Apart from error handling, which turns out to be quite easy, a few pieces are still missing. Going way back to our Cloudwatch entrypoint, we see that we need a Between type and a function name. Where do those two come from?

