The best thing that JavaScript ever got was closures. A function in JavaScript has access to any variables defined in the outer scope. Closures are best explained with examples: function outerFunction(arg:String) { var variableInOuterFunction = arg; function bar() { console.log(variableInOuterFunction); // Access a variable from the outer scope } // Call the local function to demonstrate that it has access to arg bar();
} outerFunction("hello closure"); // Result: hello closure You can see that the inner function has access to a variable (variableInOuterFunction) from the outer scope. The variables in the outer function have been closed by (or bound in) the inner function. Hence the term closure . The concept in itself is simple enough and pretty intuitive. Now the awesome part: The inner function can access the variables from the outer scope even after the outer function has returned . This is because the variables are still bound in the inner function and not dependent on the outer function. Again let's look at an example: function outerFunction(arg) { var variableInOuterFunction = arg; return function() { console.log(variableInOuterFunction); }
} var innerFunction = outerFunction("hello closure!"); // Note the outerFunction has returned
innerFunction(); // logs hello closure!

