The !! pattern Quite commonly it helps to be explicit that the intent is to treat the value as a boolean and convert it into a true boolean (one of true|false). You can easily convert values to a true boolean by prefixing it with !! e.g. !!foo. Its just ! used twice . The first ! converts the variable (in this case foo) to a boolean but inverts the logic ( truthy -!> false, falsy -!> true). The second one toggles it again to match the nature of the original object (e.g. truthy -!> false -!> true). It is common to use this pattern in lots of places e.g. // Direct variables
const hasName = !!name; // As members of objects
const someObj = { hasName: !!name
} // e.g. in ReactJS JSX
{!!someName && <div>{someName}</div>}

