import {iso, Newtype} from "newtype-ts";
import {PositiveInteger} from "newtype-ts/lib/PositiveInteger";
import * as E from "fp-ts/lib/Either";
import * as O from "fp-ts/lib/Option"; Note: We often use the Event suffix for incoming data with the AWS Lambda computing platform because Lambdas are run in response to events. In that case, the above would be UserRegistrationEvent. DTO (Data Transfer Object) is another nice suffix, signifying that this is untrusted, outside information. Were still on the edge of our domain/application, and transformations must happen before this DTO becomes a trusted object within our domain. We create a User return BasicUser (the TypeScript compiler will already complain about its return) and make addStatus return the real user. One annoying thing is that we added an optional field that might make using User more difficult. Another approach would be to change the existing type to something like BasicUser or UnvalidatedUser, subsequently reintroducing the User type, but this time with a required customer type as shown below: export type BasicUser = { firstName: FirstName, lastName: LastName, age: PositiveInteger, gender: Gender, region: Region,
};
export type UserRegistrationDto = { firstName: string, lastName: string, age: number, sex: string, country: string,
}; We should try to change the DTO properties into something more limited and, therefore, easier for the compiler to work with. This is common practice in Domain-Driven Design (DDD). We change information from the outside into something suitable for use within the domain. Similarly, anything returned to the outside world is again transformed to be useful to outside parties, in addition to ourselves. Lets take a look at the following example. Although we need to add an extra bit of code, the types we created are powerful. Before moving on, we should mention that both Gender and Region are called Sum types in functional programming. This is a kind of Algebraic Data Type (ADT). Sum types limit the type option to a list of exclusive choices. We can only pick one choice. Were either children or adults, employed or unemployed. A boolean is an example of a sum type with two choices, true or false. Product types are another group of ADTs. Our incoming DTO is an example of a product type, where the possible choices are products of their properties. Theyre useful and unavoidable. The number of possible combinations of values explodes rapidly, though. Also, the more possible values, the less our compiler can help us. For example, a Purchase that has been paid for ( isPaid is set to true ) will need shipping information. We have to make shipping information optional because it isnt a required part of an unpaid Purchase. A developer or business expert could now add a shipping address to an unpaid purchase by mistake. In this instance, the compiler can no longer help us because a shipping address is perfectly acceptable for the Purchase type. This wouldnt be the case if we use type alias. So, in most situations, Sum types are superior to (boolean) flags. // user registration dto from before
// first attempt at modeling the user = identical to incoming event. the below is better. restricting to valid values
export type Gender = 'M' | 'F' | 'X'; export type Europe = { readonly _type: 'Europe', // optionally: still keep region here as string. not doing that
}
export type NorthAmerica = { readonly _type: 'NorthAmerica',
}
export type Other = { readonly _type: 'Other',
}
export type Region = Europe | NorthAmerica | Other; Here, we pick names and tell the library that these will be newtypes for string. According to the fp-ts newtype library, performance for its implementation is almost the same as primitive types. So, unless you have a very performance-sensitive application, you should be fine. export interface FirstName extends Newtype<{ readonly FirstName: unique symbol }, string> {}
export interface LastName extends Newtype<{ readonly LastName: unique symbol }, string> {} These arent needed yet, but theyll allow us to transform our newtypes into strings and vice versa. export const firstNameIso = iso<FirstName>();
export const lastNameIso = iso<LastName>(); Now, we start using both the two newtypes we defined and the built-in PositiveInteger. Now, if we try to pass an ordinary string to our Users name fields, the compiler will reject them. Only newtypes are good enough for our fancy type! export type CustomerType = 'Normal' | 'VIP'; export type User = { firstName: FirstName, lastName: LastName, age: PositiveInteger, gender: Gender, region: Region, customerType?: CustomerType, }; export type FieldsNotEmpty = (e: UserRegistrationDto) => E.Either<string, UserRegistrationDto>;
export type ValidateAge = FieldsNotEmpty;
export type ValidateGender = FieldsNotEmpty;
export type ValidateNotGerman = FieldsNotEmpty;
export type CreateUser = (f: FirstName, l: LastName, a: PositiveInteger, g: Gender, r: Region) => User;
export type FindRegion = (country: string) => O.Option<Region>;
export type FindGender = (sex: string) => O.Option<Gender>; export type Response = { status: number, message: string,
};

