}; In our case, left (or error) is a string, so we need a semigroup that can combine two strings. There are multiple options, like creating a new string from the concatenation of the two input strings. That said, well change the signature of our functions and start using a string array as our left, which is why we need a semigroup that can combine arrays . Luckily, there is a built-in method for that, which we just imported from the NonEmptyArray module . See below: const fieldsNotEmpty: FieldsNotEmpty = (e) => { return e.firstName && e.lastName && e.age && e.sex && e.country ? E.right(e) : E.left('Not all required fields were filled in.');
};
const validateAge: ValidateAge = (e) => { return e.age >= 18 && e.age < 150 ? E.right(e) : E.left(`Received an invalid age of ${e.age}`);
};
const validateGender: ValidateGender = (e) => { return e.sex === 'M' || e.sex === 'F' || e.sex === 'X' ? E.right(e) : E.left(`Received an invalid sex ${e.sex}`);
}; const createUser: CreateUser = (firstName, lastName, age, gender, region) => ({ firstName, lastName, age, gender, region
});
const findRegion: FindRegion = (country) => { return countryMappings[country] ? O.some(countryMappings[country]) : O.none;
};
const validateNotGerman: ValidateNotGerman = (e) => { return e.country !== 'Germany' ? E.right(e) : E.left("We don't like your kind around here");
};
const customerTypeLensAlt = Lens.fromPath<AlternativeUser>()( ['additionalInfo', 'otherInfo', 'customerType']); const addStatusAlt = (u: AlternativeUser) => { const modified = customerTypeLensAlt .modify(c => c ? c : u.gender !== 'M' ? 'VIP' : 'Normal'); return modified(u);
};
console.log(addStatusAlt({gender: 'M', additionalInfo: { otherInfo: {} }} as AlternativeUser)) There are several ways of writing this piece of code. We do another validation that tells TypeScript that the string is indeed of type Gender. If the string doesnt match one of the Gender values, we return none. Alternatively, we couldve gone for type assertions (sex as Gender) because, at this point, were pretty sure we have the right kind of string. const findGender: FindGender = (sex) => { return sex === 'M' || sex === 'F' || sex === 'X' ? O.some(sex) : O.none;
}; // examples
const exampleEvent: UserRegistrationDto = { firstName: 'Test', lastName: 'McTestFace', sex: 'M', age: 18, country: 'Belgium',
} Remember, we have to use chain because were getting back an Either. Without it, nothing would be flattened and wed get Either<string, Either> monstrosities. Note that were using point-free style again by only passing in the names of the functions. The downside of this approach is that were creating many variables that only get passed to the next chain. This requires additional typing. We can do a better job with pipe: We dont have to pass content into the chains explicitly, and we only need a variable for the result. The more maps and chains, the cleaner this solution becomes compared to the previous approach. Also, with piping, the amount of explicit typing we need is limited compared to other approaches. Note that the checks we defined can be used in many different scenarios and are combined quite elegantly by a pipe. Note: It can be useful to break the above pipe and see what kind of type errors (if any) it starts spewing. What happens if we make a chain return a string or a number? What happens if we return a right with a different kind of value inside? const result = pipe( fieldsNotEmpty(exampleEvent), E.chain(validateAge), E.chain(validateGender),
);
// console.log(result) const first = fieldsNotEmpty(exampleEvent);
const second = E.chain(validateAge)(first)
const third = E.chain(validateGender)(second);
// console.log(third); // note: still only gives back one error
const eitherSequence = sequenceT(E.either);
const res = pipe( eitherSequence(fieldsNotEmpty(exampleEvent), validateGender(exampleEvent), validateAge(exampleEvent)), E.map(([a, b, c]) => a)
)
console.log(res) The sequenceT runs multiple functions. The T stands for tuple because that is how we are passing them in. Alternatively, we can use sequenceS, where the S stands for struct, that is, an object. The recommended way of lifting in fp-ts is somewhat different from many other programming languages/frameworks. Were advised to use the sequence, as we did for validation. line of e => sequenceForOption(...) & O.map() In the case of success, each check returns a result (the UserRegistrationDto). So, if everything goes well, well have the same success value five times! We use map to take only the first value of this array of identical DTOs, but picking the second or fifth elements wouldve worked equally well. Were again using a pipe to combine various actions. First, we pass in our example event, which is then passed to our sequenceForOption. In that sequence, we call several functions. The first and last names, on lines 9 and 10, must be transformed into the right newtypes because they dont return an Option. Therefore, we wrap them in one. The following three functions all return Options, so no wrapping is needed. Finally, we use map to pass the results of these functions to createUser. When we call this pipe with a valid UserRegistrationDto, we get back a user within an Option. If one or more of the functions failed (and returned none), we get back an empty Option. The overall result is nice because all our functions are kept short, clean, and understandable. We also understand the monad constructors (left, right, some, and many others) are called lifting functions because they lift the given value into the monad. Note that map helps us lift functions that deal with ordinary values into the monadic world as well. const sequenceForOption = sequenceT(O.option); const user = pipe( exampleEvent, e => sequenceForOption( O.some(firstNameIso.wrap(e.firstName)), O.some(lastNameIso.wrap(e.lastName)), prismPositiveInteger.getOption(e.age), findGender(e.sex), findRegion(e.country), ), O.map(([f, l, a, g, c]) => createUser(f, l, a, g, c))
);
// console.log(user); In the type below, the status will be a 2xx, 4xx, or 5xx number signifying success or failure (similar to HTTP response code), and a message will give additional information. Lets look at them below. Well also add some pure helper functions to create responses. const internalServerError = (): Response => ({ status: 500, message: 'failed to create',
});
const badRequest = (exception: string): Response => ({ status: 400, message: exception,
});
const createdResponse = (message: string): Response => ({ status: 201, message,
}); We could factor out some duplication here, but this example is good enough for now. Lets review an example where we use these functions: The userResponse function builds our user. It logs a message, which is a stand-in for a call to a database, and builds a response. The response is either a 201 in case of success or a 500 in case of a failure (we assume our validation will stop any errors caused by the user, so a 5xx seems appropriate). We use getOrElse for the latter, which well call the internalServerError function if its passed a none. This function either assembles a user and logs, or it becomes empty at some point and goes to the fallback function. function userResponse(u: UserRegistrationDto) { // almost everything is the same as before return pipe( u, e => sequenceForOption( O.some(firstNameIso.wrap(e.firstName)), O.some(lastNameIso.wrap(e.lastName)), prismPositiveInteger.getOption(e.age), findGender(e.sex), findRegion(e.country), ), O.map(([f, l, a, g, c]) => createUser(f, l, a, g, c)), O.map(addStatus), O.map(u => { console.log(`Created ${JSON.stringify(u)}. Could now save in db`); return createdResponse(`Created ${JSON.stringify(u)}`); }), O.getOrElse(internalServerError), );
} This is our entire workflow brought together. First, we conduct our three checks, fieldsNotEmpty, validateAge, and validateGender. Next, we use the function defined in line 1, userResponse, to create the user and get a response. Finally, we either retrieve the answer from that function or return a 400 ('bad request') if our validation fails. We use Eithers getOrElse, which is similar to that of Option. function flow(u: UserRegistrationDto) { return pipe( fieldsNotEmpty(u), E.chain(validateAge), E.chain(validateGender), E.chain(validateNotGerman), E.map(userResponse), E.getOrElse(badRequest), );
}
console.log(flow(exampleEvent));

