Suppose were working on the application from the last challenge. We want to extend it with an additional function called checkDecentHour, which takes a number and returns a left with the way too early stringwhen the hour is before8`. In our application function, we now want to check whether its way too early after checking whether the hour is valid. Instead of returning a default error message as we did earlier, we want to give back whatever error we had. // Note that you could also use the fp-ts identity function in getOrElse const checkValidHour = (hour: number): E.Either<string, number> => { return hour > 0 && hour <= 24 ? E.right(hour) : E.left('invalid hour');
}; const mapToGreeting = (hour: number): string => { return hour < 12 ? 'good morning' : 'good afternoon';
}; const checkDecentHour = (hour: number): E.Either<string, number> => { return hour >= 8 ? E.right(hour) : E.left('way too early');
}; const application = (hour: number) => { return pipe( checkValidHour(hour), E.chain(checkDecentHour), h => E.map(mapToGreeting)(h), E.getOrElse(err => err), );
};
