type Dollar = { _type: 'dollar'
}
type Euro = { _type: 'euro'
} type Currency = Dollar | Euro; type Money = { amount: number, currency: Currency,
}
export const dollars = (amount: number): Money => ({ amount, currency: { _type: 'dollar', }
}); export const euros = (amount: number): Money => ({ amount, currency: { _type: 'euro', }
});
export function count(...ms: Money[]) { return ms.reduce((acc, curr) => { if (curr.currency._type === 'dollar') { acc.dollars += curr.amount; } else { acc.euros += curr.amount; } return acc; }, {dollars: 0, euros: 0});
} Note that JavaScript and TypeScript arent ideal as languages for a fluent DSL, partly because they lack infix operators. In languages like Haskell, Purescript, or Kotlin, we can do something like this (after creating infix functions count, dollars, euros, and and): count 2 dollars and 3 euros But TypeScript doesnt support infix because JavaScript doesnt. So, our DSLs are, unfortunately, less readable. Furthermore, the difference between the above and what we were doing in previous chapters is subtle. Were thinking even more about naming. What will make our code easy to understand by outsiders and non-technical people? Were thinking about ease of use as well. That is, how can we make creating Money as simple as possible (using, among other things, our smart constructors)? Do we have to force the users of our language to pass an array to count? No, use the spread operator, and they can pass in anything they like, as long as its money. Somewhat less important in our example is what information we expose. We export those functions our users need, like methods for creating amounts in dollars or euros. We dont see a reason for them to create a currency directly, so we hide that. A large application written in FP, using DSLs, would consist of code organized in modules with clear responsibilities or a single concern (like handle authentication). Each module offers a DSL that simplifies usage, at the same time hiding implementation details. A developer who has a need for something like authentication doesnt have to dive into the code. They turn to the DSL. This method is good for keeping the code manageable, organized, and understandable. In FP, the mini-language we create is often called an Algebra. In our above example, count is part of the Algebra of our application. You can write your DSL with the techniques we saw in previous chapters. Or you can turn to some more advanced techniques discussed in the upcoming lessons. And, like anything advanced that weve seen so far, those techniques revolve around the use of monads.

