}; type ArrivalFlight = { type: 'Arrival', arrivalTime: Date, airplane: Airplane,
}; type DepartureFlight = { type: 'Departure' departureTime: Date, airplane: Airplane
} type Flight = ArrivalFlight | DepartureFlight; type KindOfFlight = 'ARRIVAL' | 'DEPARTURE'; const createAirplane = (seats: number): O.Option<Airplane> => { return seats && seats > 0 ? O.some({ seats }) : O.none;
};
