Bird.prototype.__proto__ = Animal.prototype;
Bird.prototype.fly = function () { console.log('fly') }; var bird = new Bird();
bird.walk();
bird.fly(); Basically bird.fly will be looked up from bird.__proto__.fly (remember that new makes the bird.__proto__ point to Bird.prototype) and bird.walk (an inherited member) will be looked up from bird.__proto__.__proto__.walk (as bird.__proto__ == Bird.prototype and bird.__proto__.__proto__ == Animal.prototype).

