In order to fully appreciate promises let's present a simple sample that proves the difficulty of creating reliable Async code with just callbacks. Consider the simple case of authoring an async version of loading JSON from a file. A synchronous version of this can be quite simple: import fs = require('fs'); function loadJSONSync(filename: string) { return JSON.parse(fs.readFileSync(filename));
} // good json file
console.log(loadJSONSync('good.json')); // non-existent file, so fs.readFileSync fails
try { console.log(loadJSONSync('absent.json'));
}
catch (err) { console.log('absent.json error', err.message);
} // invalid json file i.e. the file exists but contains invalid JSON so JSON.parse fails
try { console.log(loadJSONSync('invalid.json'));
}
catch (err) { console.log('invalid.json error', err.message);
} There are three behaviors of this simple loadJSONSync function, a valid return value, a file system error or a JSON.parse error. We handle the errors with a simple try/catch as you are used to when doing synchronous programming in other languages. Now let's make a good async version of such a function. A decent initial attempt with trivial error checking logic would be as follows: import fs = require('fs'); // A decent initial attempt .... but not correct. We explain the reasons below
function loadJSON(filename: string, cb: (error: Error, data: any) => void) { fs.readFile(filename, function (err, data) { if (err) cb(err); else cb(null, JSON.parse(data)); });
} Simple enough, it takes a callback, passes any file system errors to the callback. If no file system errors, it returns the JSON.parse result. A few points to keep in mind when working with async functions based on callbacks are: Never call the callback twice. Never throw an error. However, this simple function fails to accommodate for point two. In fact, JSON.parse throws an error if it is passed bad JSON and the callback never gets called and the application crashes. This is demonstrated in the below example: import fs = require('fs'); // A decent initial attempt .... but not correct
function loadJSON(filename: string, cb: (error: Error, data: any) => void) { fs.readFile(filename, function (err, data) { if (err) cb(err); else cb(null, JSON.parse(data)); });
} // load invalid json
loadJSON('invalid.json', function (err, data) { // This code never executes if (err) console.log('bad.json error', err.message); else console.log(data);
}); A naive attempt at fixing this would be to wrap the JSON.parse in a try catch as shown in the below example: import fs = require('fs'); // A better attempt ... but still not correct
function loadJSON(filename: string, cb: (error: Error) => void) { fs.readFile(filename, function (err, data) { if (err) { cb(err); } else { try { cb(null, JSON.parse(data)); } catch (err) { cb(err); } } });
} // load invalid json
loadJSON('invalid.json', function (err, data) { if (err) console.log('bad.json error', err.message); else console.log(data);
}); However, there is a subtle bug in this code. If the callback (cb), and not JSON.parse, throws an error, since we wrapped it in a try/catch, the catch executes and we call the callback again i.e. the callback gets called twice! This is demonstrated in the example below: import fs = require('fs'); function loadJSON(filename: string, cb: (error: Error) => void) { fs.readFile(filename, function (err, data) { if (err) { cb(err); } else { try { cb(null, JSON.parse(data)); } catch (err) { cb(err); } } });
} // a good file but a bad callback ... gets called again!
loadJSON('good.json', function (err, data) { console.log('our callback called'); if (err) console.log('Error:', err.message); else { // let's simulate an error by trying to access a property on an undefined variable var foo; // The following code throws `Error: Cannot read property 'bar' of undefined` console.log(foo.bar); }
}); $ node asyncbadcatchdemo.js
our callback called
our callback called
Error: Cannot read property 'bar' of undefined This is because our loadJSON function wrongfully wrapped the callback in a try block. There is a simple lesson to remember here. Simple lesson: Contain all your sync code in a try catch, except when you call the callback. Following this simple lesson, we have a fully functional async version of loadJSON as shown below: import fs = require('fs'); function loadJSON(filename: string, cb: (error: Error) => void) { fs.readFile(filename, function (err, data) { if (err) return cb(err); // Contain all your sync code in a try catch try { var parsed = JSON.parse(data); } catch (err) { return cb(err); } // except when you call the callback return cb(null, parsed); });
} Admittedly this is not hard to follow once you've done it a few times but nonetheless its a lot of boiler plate code to write simply for good error handling. Now let's look at a better way to tackle asynchronous JavaScript using promises.

