The promise fate can be subscribed to using .then (if resolved) or .catch (if rejected). const promise = new Promise((resolve, reject) => { resolve(123);
});
promise.then((res) => { console.log('I get called:', res === 123); // I get called: true
});
promise.catch((err) => { // This is never called
}); const promise = new Promise((resolve, reject) => { reject(new Error("Something awful happened"));
});
promise.then((res) => { // This is never called
});
promise.catch((err) => { console.log('I get called:', err.message); // I get called: 'Something awful happened'
}); TIP: Promise Shortcuts Quickly creating an already resolved promise: Promise.resolve(result) Quickly creating an already rejected promise: Promise.reject(error)

