Just wrap the function call in a promise and reject if an error occurs, resolve if it is all good. E.g. let's wrap fs.readFile: import fs = require('fs');
function readFileAsync(filename: string): Promise<any> { return new Promise((resolve,reject) => { fs.readFile(filename,(err,result) => { if (err) reject(err); else resolve(result); }); });
} The most reliable way to do this is to hand write it and it doesn't have to be as verbose as the previous example e.g. converting setTimeout into a promisified delay function is super easy: const delay = (ms: number) => new Promise(res => setTimeout(res, ms)); Note that there is a handy dandy function in NodeJS that does this node style function => promise returning function magic for you: /** Sample usage */
import fs from 'fs';
import util from 'util';
const readFile = util.promisify(fs.readFile); Webpack supports the util module out of the box and you can use it in the browser as well. If you have a node callback style function as a member be sure to bind it as well to make sure it has the correct this: const dbGet = util.promisify(db.get).bind(db);
